  const image3 = require("../assets/connect02.jpeg");
  const image4 = require("../assets/connect01.jpeg");

  return (
    <View style={globalStyles.eventContainer}>
      <SafeAreaView style={globalStyles.darkHeader}>
        <Text style={globalStyles.headerText}>Equippers</Text>
      </SafeAreaView>
      <ScrollView>
        <View style={globalStyles.eventContent}><Eventsmodal /></View>

      </ScrollView>
    </View>
  );
}
